import Loadable from 'react-loadable'
import React from 'react'
class Loading extends React{
    render() {
        return (
            <div></div>
        )
    }
}
export default {
    loadableComponent(component) {
        return Loadable({
            loader: component,
            loading: Loading
        })
    }
}
